import React from "react";
import './Error.scss'

export class Error extends React.Component {
  render() {
    return (
    <div className="error-img">
      <img  src="https://freefrontend.com/assets/img/html-funny-404-pages/CodePen-404-Page.png" alt="404"/>
    </div>)
  }
}

export default  Error;
